import React from "react";
import App from "../App";
import Start from "../components/Start";
import {BrowserRouter,Routes,Route} from "react-router-dom"


const BaseRouter=()=>
    {
    return (
    <BrowserRouter>
        <Routes>
            <Route path="/" element={<Start />}></Route>
            <Route path="/content" element={<App />}>
                
            </Route>
        </Routes>
    </BrowserRouter>
    )
    }


export default BaseRouter
